import { Component } from '@angular/core';
// import './hmepage.component.css';
@Component({
  selector: 'app-homepage',
  templateUrl: 'homepage.component.html',
  styleUrls: ['homepage.component.css']
})
export class HomepageComponent {

}
<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
<link rel="stylesheet" href="homepage.component.css">
    <title>Homepage</title>
    </head>
    <STYLE>      

    </STYLE>
    <body>
        <div class="container"><div class="member"><a routerLink="../member">Members Manager</a></div><div class="event">&nbsp;
            <a routerLink="../event">Events Manager</a></div></div>
    </body>
    </html>
